package parimala;

public class Divisible {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=90;
		int b=5;
		if(a%b==0) {
			System.out.println("a is divisible by b:"+true);
		}
		else {
			System.out.println("a is divisible by b:"+false);
		}
	}

}
